export default {
    name: 'baseform',
    data: function(){
        return {
            tableData: []
        }
    },
    methods: {
        onSubmit() {
            this.$message.success('提交成功！');
        },
        getData() {
            // 开发环境使用 easy-mock 数据，正式环境使用 json 文件
            // if (process.env.NODE_ENV === 'development') {
                this.url = 'https://www.easy-mock.com/mock/5cfdf3b46b3bca3c744e7543/example/ms/table/list';
            // };
            this.$axios.post(this.url, {
                page: this.cur_page
            }).then((res) => {
                this.tableData = res.data.list;
            })
        },
        created() {
            this.getData();
        }
    },
    computed: {
        casename() {
            return this.$route.query.name
        }
    }
}
